script: |
  super -f tsv -I q1123.sql | sort > q1123.out

vector: true

inputs:
  - name: q1123.sql
    data: |
      SELECT DISTINCT + + cor0.col1 * + 76 AS col0 FROM tab2 AS cor0 CROSS JOIN tab1, tab0 AS cor1, tab0, tab0 AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q1123.out
    data: |
      1292
      2356
      4484
